TikTok (w Chinach jako Douyin) – mobilna aplikacja internetowa, której główna funkcja polega na możliwości publikowania krótkich materiałów wideo, w założeniu formą zbliżonych do teledysków muzycznych. Stworzona przez chińskie przedsiębiorstwo ByteDance we wrześniu 2016. Dostępna w kilkudziesięciu wersjach językowych. W kwietniu 2020 korzystało z niej dwa miliardy użytkowników, była to najczęściej pobierana aplikacja na świecie. We wrześniu 2017 przedsiębiorstwo ByteDance, będące właścicielem TikToka, przejęło za cenę miliarda USD popularną w Europie i Stanach Zjednoczonych konkurencyjną aplikację musical.ly.41% użytkowników TikToka jest w wieku od 16 do 24 lat. W debacie publicznej prowadzonej w niektórych krajach (m.in. Bangladeszu, Indonezji, Indiach, Pakistanie) wyrażane są opinie, wedle których aplikacja przyczynia się do rozpowszechnia treści mających charakter nieobyczajny. W odpowiedzi na te zastrzeżenia TikTok zapowiadał wprowadzenie zmian mających rozwiązać problem. Brytyjski dziennik The Guardian ujawnił, że moderatorzy platformy byli instruowani do cenzurowania filmów, w których wspominano krytyczne wobec autorytarnych władz Chin kwestie polityczne, takie jak: masakra na placu Tian’anmen, niepodległość Tybetu czy działalność grupy religijnej Falun Gong. Filmy te są albo usuwane, albo ogranicza się ich zasięg. Ujawniono obowiązujący zakaz krytyki systemów politycznych. W 2019 firma została ukarana w Stanach Zjednoczonych rekordową grzywną 5,7 miliona dolarów za nielegalne gromadzenie danych osobowych dzieci. Ograniczenie dostępu do TikToka zostało wprowadzone czasowo lub trwale w: Indonezji (lipiec 2018), Bangladeszu (listopad 2018), Indiach (kwiecień 2019, czerwiec 2020) oraz Pakistanie (październik 2020, marzec 2021). W Polsce (w 2020) 90% użytkowników aplikacji stanowiły osoby w wieku poniżej 18 lat. 66% posiadaczy kont było użytkownikami aktywnymi (publikującymi treści). 95% użytkowników stanowiły kobiety. 90% użytkowników oceniało serwis pozytywnie. Badania pokazują, że TikTok gromadzi znaczną ilość danych użytkownika. Aplikacja wymaga uprawnień do lokalizacji użytkownika, nagrań dźwiękowych i kamer oraz kontaktów. Popularne formy materiałów wideo na TikTok to m.in.: 
* lip-sync – twórca tańczy i naśladuje oryginalnego wykonawcę utworu, udając, że śpiewa (zbliżone do playbacku); 
* stand-up – krótki występ komediowy; 
* pokaz – prezentacja jakiejś umiejętności akrobatycznej, tanecznej, sportowej; 
* tutorial – poradnik. Szczególnie popularne są te dotyczące makijażu czy domowych trików; 
* stream – relacja na żywo
